import './App.css';
import React, { useState } from 'react';

function App() {
    // const [view_tick,set_tick] = useState(0);
    return (
        <div className="App">
            <header id="header">
                <a href="#">Home</a>
                <a href="#">Policy</a>
                <a href="#">Content</a>
            </header>
            <div id="main">
                {new Date().toLocaleTimeString()}
            </div>
            <footer id="footer">Footer</footer>
        </div>
    );
}

export default App;
